package PairNumbers;

public class Pair <K,V> {

    //Atributos

    private K key;
    private V value;

    //Construtor

    public Pair( K key, V value){
        this.key = key;
        this.value = value;


    }

    public K getKey() {
        return key;
    }

    public V getValue() {
        return value;
    }

    public void setKey(K key) {
        this.key = key;
    }

    public void setValue(V value) {
        this.value = value;
    }

    @Override
    public String toString() {
        return "Pair{" +
                "key=" + key +
                ", value=" + value +
                '}';
    }
}
